import React from 'react';
import Login from './Login';
import { AppRoute } from './AppRoute'
import StatiquePage from './StatiquePage';
import NivBase from './NivBase'
import AjoutNivBase from './AjoutNivBase'
import ModifNivBase from './ModifNivBase'
import Matieres from './Matieres'
import TypeEnseign from './TypeEnseign'
import AjoutTypeEnseign from './AjoutTypeEnseign'
import { Link, BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Switch>
        <AppRoute path="/AjoutTypeEnseign" component={AjoutTypeEnseign} layout={StatiquePage}></AppRoute>
        <AppRoute path="/ModifNivBase" component={ModifNivBase} layout={StatiquePage}></AppRoute>
        <AppRoute path="/AjoutNivBase" component={AjoutNivBase} layout={StatiquePage}></AppRoute>
        <AppRoute path="/TypeEnseign" component={TypeEnseign} layout={StatiquePage}></AppRoute>
        <AppRoute path="/Matieres" component={Matieres} layout={StatiquePage}></AppRoute>
        <AppRoute path="/NivBase" component={NivBase} layout={StatiquePage}></AppRoute>
        <Route path="/" render={() => <Login />} />
      </Switch>
    </Router>
  );
}

export default App;
